import React from 'react'
import './NewsCard.css'
import icon from '../../images/Rectangle 8.svg'

function NewsCard() {
    return(
        <div className="newsCard">
            <div className="newsCard__image">
                <div className="newsCard__button">
                    <img className="newsCard__button-img" src={icon} alt="кнопка сохранения"/>
                </div>
            </div>
        </div>
    )
}

export default NewsCard;
